import '../node_modules/bootstrap/dist/css/bootstrap.css';
import axios from 'axios';
import { useEffect, useState } from "react"; 

function InstituteRegForm(){
  const [name, setName] = useState("");
  const [address, setAddress] = useState("");
  const [city, setCity] = useState("");
  const [state1, setState1] = useState("");
  const [pincode, setPincode] = useState("");
  const [university, setUniversity] = useState("");
  const [course, setCourse] = useState("");
  const [data, setData] = useState("");



  async function save(event){
    event.preventDefault();
    try {
        await axios.post("http://192.168.144.185:8080/institute",{
        name:name,
        address:address,
        city:city,
        state1:state1,
        pincode:pincode,
        university:university,

    });
    alert("Institute registration sccessful")

    } catch (error) {
      alert("Institute registration failed")
    }
  }

  const url="http//192.168.144.185:8080/course";

  const fetchInfo = ()=>{
    return axios.get(url).then((response)=>response.json()).then((data)=>setData(data));
  }
  useEffect(()=>{
    fetchInfo();
  },[])



    return(


        <div className="container" >
            <div className="py-5 text-center">

              <h2>Institute Registration form</h2>
              <p className="lead"></p>
            </div>

            <div className="row">

              <div className="col-md-12 order-md-3">
                <h4 className="mb-3"></h4>

                  <div className="row">
                    <div className="col-md-4 mb-3">
                      <label for="name">InstituteName*</label>
                      <input type="text" className="form-control" id="firstName" placeholder="" value={name}
                      onChange={(event)=>{
                        setName(event.target.value);
                      }}required/>

                </div>  
                </div> 

                <div className="mb-3">
                    <label for="address">Permanent Address*</label>
                    <input type="text" className="form-control" id="address" placeholder="" value={address}
          onChange={(event) => setAddress(event.target.value)}required/>
                    {/* <div className="invalid-feedback">
                      Please enter your valid Permanent address.
                    </div> */}
                  </div>

                  <div className="col-md-4 mb-3">
                        <label for="city">City*</label>
                        <input type="text" className="form-control" id="city" placeholder="" value={city}
          onChange={(event) => setCity(event.target.value)}required/>
                        {/* <div className="invalid-feedback">
                          Please provide a valid district.
                        </div> */}
                      </div>

                <div className="col-md-4 mb-3">
                      <label for="state1">State*</label>
                      <select className="custom-select d-block w-100" id="state1" value={state1}
          onChange={(event) => setState1(event.target.value)}required>
                        <option value="">Choose...</option>
                        <option>Maharashtra</option>
                        <option>Madhya Pradesh</option>
                        <option>Delhi</option>
                      </select>
                      {/* <div className="invalid-feedback">
                        Please provide a valid state.
                      </div> */}
                    </div>

                    <div className="col-md-4 mb-3">
                        <label for="pincode">Pincode*</label>
                        <input type="text" className="form-control" id="city" placeholder="" value={pincode}
          onChange={(event) => setPincode(event.target.value)}required/>
                        {/* <div className="invalid-feedback">
                          Please provide a valid district.
                        </div> */}
                      </div>

                      <div className="col-md-4 mb-3">
                        <label for="university">University*</label>
                        <input type="text" className="form-control" id="university" placeholder="" value={university}
          onChange={(event) => setUniversity(event.target.value)}required/>
                        {/* <div className="invalid-feedback">
                          Please provide a valid district.
                        </div> */}
                      </div>

                  </div>

                  <div className="col-md-4 mb-3">
                      <label for="state1">Courses*</label>
                      <select className="custom-select d-block w-100" id="state1" value={course}
          onChange={(event) => setCourse(event.target.value)}required>

                        <option>B.Tech</option>
                        <option>MBA</option>
                        <option>B.Sc</option>
                        <option>MBBS</option>
                      </select>
                      {/* <div className="invalid-feedback">
                        Please provide a valid state.
                      </div> */}
                    </div>


                    <hr className="mb-4"/>
                    <div className="row" Style="justify-content: center;">
                        <div className="col-md-4 mb-3">
                            <button className="btn btn-primary btn-lg btn-block" Style="align-content: center;" type="submit" onClick={save}>Continue to checkout</button>
                        </div>
                    </div>

                    <div>
                  </div>

              </div>
              </div>

    );
}

export default InstituteRegForm;
